s field previously created is in string 'mmmm'('%B') format, but for orderly printing in viz, a number format is needed, thus a pipeline is created with the mutate function creating the '%m' numeric format month.\n","* The ride count, avg ride distance and avergae ride length all are created with the same consideration as in the previous stat.\n","* The results are then arranged first by the numeric format month and then by user type."]},{"cell_type":"code","execution_count":16,"id":"e3a9fb1f","metadata":{"execution":{"iopub.execute_input":"2022-07-30T21:23:13.522509Z","iopub.status.busy":"2022-07-30T21:23:13.520683Z","iopub.status.idle":"2022-07-30T21:23:15.85274Z","shell.execute_reply":"2022-07-30T21:23:15.850796Z"},"papermill":{"duration":2.355909,"end_time":"2022-07-30T21:23:15.856602","exception":false,"start_time":"2022-07-30T21:23:13.500693","status":"completed"},"tags":[]},"outputs":[],"source":["usertype_month_stat <- tripdata_2021 %>%\n","                mutate(month_num = format(as.Date(started_at), \"%m\")) %>%\n","                group_by(month_num, member_casual) %>%\n","                summarise(ride_cnt = n(), mean_distance = mean(!is.na(ride_distance)), mean_time = mean(ride_length), .groups = \"drop\") %>%\n","                arrange(month_num , member_casual)"]},{"cell_type":"markdown","id":"36bb3cf3","metadata":{"papermill":{"duration":0.017494,"end_time":"2022-07-30T21:23:15.892073","exception":false,"start_time":"2022-07-30T21:23:15.874579","status":"completed"},"tags":[]},"source":["The summarised data can be viewed to find out patterns, but its best practice to visualize too."]},{"cell_type":"code","execution_count":17,"id":"60d35b75","metadata":{"execution":{"iopub.execute_input":"2022-07-30T21:23:15.931071Z","iopub.status.busy":"2022-07-30T21:23:15.929448Z","iopub.status.idle":"2022-07-30T21:23:15.967149Z","shell.execute_reply":"2022-07-30T21:23:15.96475Z"},"papermill":{"duration":0.059828,"end_time":"2022-07-30T21:23:15.969743","exception"