he annual members there is a small difference of usage between the start of the week, where they prefer the classic bike and the end of the week, where they use more electric bikes.\n","* For the casual users we see in general the same pattern of usage from the previous weekly charts, preferring the electric vs the classic bikes and having a weekend usage of the service."]},{"cell_type":"markdown","id":"b752ddda","metadata":{"papermill":{"duration":0.021958,"end_time":"2022-07-30T21:23:30.144598","exception":false,"start_time":"2022-07-30T21:23:30.12264","status":"completed"},"tags":[]},"source":["**6)** ***Most popular staion and rides by user-type on map***\n","* First all the null coordiantes are dropped.\n","* Then round trip routes are ommited from the analysis (although we know from SQL analysis that they form the majority of popular casual routes) as they are hard to visualize on map.\n","* Trips routes having more than 250 rides are selected for viz."]},{"cell_type":"code","execution_count":24,"id":"40de6aea","metadata":{"execution":{"iopub.execute_input":"2022-07-30T21:23:30.192803Z","iopub.status.busy":"2022-07-30T21:23:30.190915Z","iopub.status.idle":"2022-07-30T21:24:20.895695Z","shell.execute_reply":"2022-07-30T21:24:20.893689Z"},"papermill":{"duration":50.731659,"end_time":"2022-07-30T21:24:20.898569","exception":false,"start_time":"2022-07-30T21:23:30.16691","status":"completed"},"tags":[]},"outputs":[],"source":["coordinates_table <- tripdata_2021 %>%\n","                drop_na(start_lng, start_lat, end_lng, end_lat) %>%\n","                filter(start_lng != end_lng & start_lat != end_lat) %>%\n","                group_by(start_lng, start_lat, end_lng, end_lat, member_casual, rideable_type) %>%\n","                summarise(total = n(), .groups = \"drop\") %>%\n","                filter(total > 250)"]},{"cell_type":"markdown","id":"f853fdb8","metadata":{"papermill":{"duration":0.022437,"end_time":"2022-07-30T21:24:20.944038","exception":false,"sta